import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './routes/Home';
//import MyPage from './routes/Mypage';
//import Edit from './routes/Edit';
import Tools from './routes/Tools';
import Login from './routes/Login';
import SignUp from './routes/Signup';

function App() {
  return (
    <Router>
      <div className="flex flex-row justify-center items-center mt-10 space-x-4">
        <Link to="/Home" className="px-4 py-2 bg-blue-500 text-white rounded-md">홈</Link>
        <Link to="/Tools" className="px-4 py-2 bg-blue-500 text-white rounded-md">부가기능</Link>
        <Link to="/Login" className="px-4 py-2 bg-blue-500 text-white rounded-md">로그인</Link>
        <Link to="/Signup" className="px-4 py-2 bg-blue-500 text-white rounded-md">회원가입</Link>
      </div>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/Tools" element={<Tools />} />
        <Route path="/Login" element={<Login />} />
        <Route path="/Signup" element={<SignUp />} />
      </Routes>
    </Router>
  );
}

export default App;


